$(function () {
  Chart.defaults.global.responsive = true
  Chart.defaults.global.scaleLineColor = 'rgba(0,0,0,.4)'
  Chart.defaults.global.customTooltips = function(tooltip) {
    var tooltipEl = $('#chartjs-tooltip')

    if (!tooltip) {
      tooltipEl.css({
        opacity: 0
      });
      return;
    }

    tooltipEl.removeClass('above below')
    tooltipEl.addClass(tooltip.yAlign)

    var innerHtml = '<div class="chartjs-tooltip-title">' + tooltip.title + ':</div>'
    for (var i = tooltip.labels.length - 1; i >= 0; i--) {
      innerHtml += [
        '<div class="chartjs-tooltip-section">',
        '	<span class="chartjs-tooltip-key" style="background-color:' + tooltip.legendColors[i].fill.replace('0.2', '1.0') + '"></span>',
        '	<span class="chartjs-tooltip-value">' + tooltip.labels[i] + '</span>',
        '</div>'
      ].join('')
    }
    tooltipEl.html(innerHtml)

    tooltipEl.css({
      opacity: 1,
      left: tooltip.chart.canvas.offsetLeft + tooltip.x + 'px',
      top: tooltip.chart.canvas.offsetTop + tooltip.y + 'px',
      fontFamily: tooltip.fontFamily,
      fontSize: tooltip.fontSize,
      fontStyle: tooltip.fontStyle,
    })
  }

  var datePickerFrom, datePickerTo
  initializeDatePickers()
  if (isHaveCharts()) { initializeChars({}) }

  $(document).on('click', '#live-poll', function (e) {
    e.preventDefault()
    $(this).toggleClass('active')
    setInterval(function () {
      updatePagePart('.live-reload', {})
    }, parseInt(localStorage.timeInterval) || 2000)
  })

  $(document).on('click', '.statistic__tab', function (e) {
    var $this = $(this)
    $('.nav-tabs li').removeClass('active')
    $this.parent().toggleClass('active')

    $('.statistic__container').children().hide()
    $($this.data('target')).show()
  })

  $(document).on('click', '.statistic__jid', function (e) {
    $('.statistic__i').toggle()
    $($(this).data('target')).parent().show()
  })

  $('#statistic__search').keyup(function() {
    var $this = $(this)
    delay(function(){
      if ($this.val().length) {
        $('.statistic__i:not(:contains('+ $this.val() +'))').hide()
      } else {
        $('.statistic__i').show()
      }
    }, 200 )
  });

  var delay = (function(){
    var timer = 0
    return function(callback, ms){
      clearTimeout (timer)
      timer = setTimeout(callback, ms)
    }
  })()

  function initializeChars(data) {
    var path = window.location.pathname
    $.getJSON(path + '/charts.json', data, function (data) {
      createChart('failed', data, data.failed_datasets)
      createChart('passed', data, data.passed_datasets)
    })
  }

  function initializeDatePickers() {
    $('#datepicker_from').datepicker({
      dateFormat: 'dd-mm-yy',
      firstDay: 1,
      maxDate: -1,
      onSelect: function (selected) {
        datePickerFrom = selected
        $("#datepicker_to").datepicker("option","minDate", selected)
        rerenderPage()
      }
    })

    $('#datepicker_to').datepicker({
      dateFormat: 'dd-mm-yy',
      firstDay: 1,
      maxDate: 0,
      onSelect: function (selected) {
        datePickerTo = selected
        $("#datepicker_from").datepicker("option","maxDate", selected)
        rerenderPage()
      }
    })
  }

  function rerenderPage() {
    if (datePickerFrom && datePickerTo) {
      var requestData = {
        dateFrom: datePickerFrom,
        dateTo: datePickerTo
      }

      updatePagePart('.statistic', requestData, function () {
        initializeChars(requestData)
      })

      $(document).ajaxComplete(function() {
        initializeDatePickers()

        $('#datepicker_from').datepicker('option','maxDate', datePickerTo)
        $('#datepicker_from').datepicker('setDate', datePickerFrom)
        $('#datepicker_to').datepicker('option','minDate', datePickerFrom)
        $('#datepicker_to').datepicker('setDate', datePickerTo)
      })

    }
  }

  function updatePagePart(selector, data, callback) {
    $.ajax({
      url: window.location.pathname,
      dataType: 'html',
      data: data
    }).done(function (data) {
      var $html = $(data).filter('#page').find(selector)
      $(selector).replaceWith($html)

      if (typeof callback === "function") {
        callback()
      }
    })
  }

  function isHaveCharts() {
    return document.getElementById("js-passed-chart") && document.getElementById("js-failed-chart")
  }

  function createChart(type, data, datasets) {
    var ctxFailed = document.getElementById("js-" + type + "-chart").getContext("2d")

    new Chart(ctxFailed).Line({
      labels: data.labels,
      datasets: datasets
    }, {
      multiTooltipTemplate: data.tooltip_template
    })
  }
})

